Information
------------------------------

In anticipation of an Allied invasion of the Philippines, Japanese commander devised a brilliant plan and a secret weapon to counter the United States' overwhelming military might. Would it be enough to overcome Admiral William Halsey's heavily reinforced protection forces?
In October 1944, U.S. troops invaded Leyte Gulf in the Philippines. It was the opening move to recapture the Philippines, occupied by the Japanese after their Pacific victories in 1941 and '42. What followed was the largest clash in naval arms in history: 216 U.S. and 64 Japanese warships in a series of dramatic battles. The outcome rested on the shoulders of the aggressive and impetuous Vice Admiral William &quot;Bull&quot; Halsey and the determined but cautious Vice Admiral Takeo Kurita.

Produced by Nugus/Martin Productions Ltd for The History Channel

